import { useState, useEffect } from 'react';

const API_URL  = 'http://www.omdbapi.com/?i=tt3896198&apikey=90b054dc';

const App = () => {

  const getMovies = async(title) => {
    const response = await fetch(`${API_URL}&s=${title}`);
    const data = await response.json();
    console.log(data);
  }
  useEffect(()=>{
    getMovies();
  }, []);
  return (
    <>
      <h1>Hello</h1>
    </>
  );
};

export default App;
